import React from "react";
const Nav = ()=>{
return(
    <div>
       
       <a href = '#'>Logo</a>
       <ul>
       <a href = '/'>Home</a>
       <a href = '/about'>About</a> 
       </ul>
    </div>
)
}
export default Nav;
